import React, { useState } from "react";
import Navbar from "../components/navbar";
import Footer from "../components/footer";
import Sidepannel from "../components/side-pannel";
import axios from "axios";

function PatientForm() {
  const [formData, setFormData] = useState({
    name: "",
    phoneNumber: "",
    blood: "", // Updated for blood type
    profileImage: "", // Fixed file handling
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const data = new FormData();
    data.append("name", formData.name);
    data.append("phoneNumber", formData.phoneNumber);
    data.append("blood", formData.blood);
    data.append("profileImage", formData.profileImage);


    try {
      const response = await axios.post(
        "http://localhost:4600/api/auth/patient", // Make sure the URL matches
        data,
        {
          headers: {
            "Content-Type": "multipart/form-data", // Ensure this header is set
          },
        }
      );


      if (response.status === 201) {
        alert("patient created successfully!");
        console.log("Server Response:", response.data);
      }
       else {
        alert("Error creating patient");
      }
    } catch (error) {
      console.error("Error submitting form:", error);
      alert("An error occurred while submitting the form");
    }
  };

  return (
    <div className="layout-wrapper layout-content-navbar">
      <div className="layout-container">
        <Sidepannel />
        <div className="layout-page">
          <Navbar />
          <div className="content-wrapper">
            <div className="container-xxl flex-grow-1 container-p-y">
              <h4 className="fw-bold py-3 mb-4">
                <span className="text-muted fw-light">Forms/</span> Patient
                Registration
              </h4>
              <div className="row">
                <div className="col-xl">
                  <div className="card mb-4">
                    <div className="card-header d-flex justify-content-between align-items-center">
                      <h5 className="mb-0">Patient Registration</h5>
                      <small className="text-muted float-end">
                        Fill the details
                      </small>
                    </div>
                    <div className="card-body">
                      <form onSubmit={handleSubmit}>
                        <div className="mb-3">
                          <label className="form-label" htmlFor="name">
                            Full Name
                          </label>
                          <input
                            type="text"
                            className="form-control"
                            id="name"
                            name="name"
                            value={formData.name}
                            onChange={handleInputChange}
                            placeholder="John Doe"
                          />
                        </div>
                        <div className="mb-3">
                          <label className="form-label" htmlFor="phoneNumber">
                            Phone Number
                          </label>
                          <input
                            type="text"
                            className="form-control"
                            id="phoneNumber"
                            name="phoneNumber"
                            value={formData.phoneNumber}
                            onChange={handleInputChange}
                            placeholder="+1234567890"
                          />
                        </div>
                        <div className="mb-3">
                          <label className="form-label" htmlFor="blood">
                            Blood Type
                          </label>
                          <input
                            type="text"
                            className="form-control"
                            id="blood"
                            name="blood"
                            value={formData.blood}
                            onChange={handleInputChange}
                            placeholder="O+, A-, B+"
                          />
                        </div>
                        <div className="mb-3">
                          <label className="form-label" htmlFor="profileImage">
                            Profile Picture
                          </label>
                          <input
                            type="file"
                            className="form-control"
                            id="profileImage"
                            name="profileImage"
                            onChange={(e) =>
                              setFormData({
                                ...formData,
                                profileImage: e.target.files[0],
                              })
                            }
                            accept="image/*"
                          />
                        </div>
                        <button type="submit" className="btn btn-primary">
                          Register Patient
                        </button>
                      </form>
                    </div>
                  </div>
                </div>
              </div>
            </div>
            <Footer />
            <div className="content-backdrop fade"></div>
          </div>
        </div>
      </div>
      <div className="layout-overlay layout-menu-toggle"></div>
    </div>
  );
}

export default PatientForm;
